import { Routes, Route, Outlet } from "react-router-dom";
import Home from "./routes/home/home.component"
import { Fragment } from "react";

const Navigation = () => {
  return (
    <Fragment>
        <h1> Navigation </h1>
        <Outlet />

    </Fragment>
  );
};

const App = () => {
  return (
    <Routes>
      <Route path="/" element={<Navigation />}>
        <Route index element={<Home />} />
      </Route>


    </Routes>
  )
}

export default App;
